'use strict';
let GetOpenPositionsMessage = require('./GetOpenPositionsMessage.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class GetOpenPositionsMessageBuilder extends GetOpenPositionsMessage {
    addOpenPosition(openPosition) {
        this.openPositionsList.add(openPosition);
    }
    addOpenPositions(openPositions) {
        let i;
        if (this.openPositionsList == null) {
            stdlib.print("openPositionsList == nil");
        }
        if (openPositions != null) {
            for (i = 0; i <= openPositions.length() - 1; i += 1) {
                this.openPositionsList.add(openPositions.get(i));
            }
        }
    }
    setAccountId(accountId) {
        this.accountId = accountId;
    }
    build() {
        return this;
    }
}
module.exports = GetOpenPositionsMessageBuilder
